function replaceImageURLs() {
  const imageTags = document.querySelectorAll('img[src*="/static/media/"]');
  imageTags.forEach((img) => {
    const fileName = img.src.split('/').pop();
    const cloudinaryURL = `https://res.cloudinary.com/demo/image/fetch/f_auto,q_50,w_auto/dpr_auto/https://offroadpioneers.com/static/media/${fileName}`;
    img.src = cloudinaryURL;
  });
}
